 6 Exkurs: Reguläre Ausdrücke 6.1 Was sind reguläre Ausdrücke? Reguläre Ausdrücke (oder engl. Regular Expression, kurz: RegEx, RegExp) sind verallgemeinerte Suchmuster (patterns) für Zeichenketten. Mithilfe von regulären Ausdrücken können syntaktische Konstrukte so beschrieben werden, dass sie ein Computer versteht. Ein syntaktisches Konstrukt ist zum Beispiel eine Zahl zwischen 1900 und 2000, eine Telefonnummer, eine Adresse, eine URL oder auch ein bestimmtes Wort in verschiedenen Flexionsformen. Mithilfe von regulären Ausdrücken können also Texte nach bestimmten Mustern durchsucht werden, und die gefundenen Konstrukte können anschließend z.B. entfernt oder bearbeitet werden. Die meisten Programmiersprachen, darunter auch R, stellen Funktionen bereit, welche die Verwendung von regulären Ausdrücken erlauben. In den Beispielen in diesem Kapitel werden wir nach Mustern in zwei deutschsprachigen Märchentexten suchen. Zur Formulierung der Suchmuster verwenden wir deswegen das deutsche Alphabet. Reguläre Ausdrücke können aber genauso für andere Alphabete, Schriftsysteme und 6.2 Reguläre Ausdrücke in R Als Beispieltexte nutzen wir die beiden Märchen Rapunzel und Aschenputtel. Zur Vorbereitung installieren wir die folgenden Pakete… install.packages(c(&quot;readtext&quot;, &quot;stringr&quot;, &quot;quanteda&quot;)) …und laden die installierten Pakete: library(readtext) library(stringr) library(quanteda) 6.2.1 R Base Funktionen In R können Texte nach regulären Ausdrücken entweder mithilfe von R-Basisfunktionen durchsucht werden, oder mithilfe von Funktionen aus spezialisierten Paketen. Zunächst betrachten wir die Basisfunktionen, und lernen später reguläre Ausdrücke selbst kennen: Funktion Bedeutung grep(), grepl() Search for matches of a regular expression/pattern in a character vector; either return the indices into the character vector that match, the strings that happen to match, or a TRUE/FALSE vector indicating which elements match. regexpr(), gregexpr() Search a character vector for regular expression matches and return the indices of the string where the match begins and the length of the match. sub(), gsub() Search a character vector for regular expression matches and replace that match with another string. Quelle: https://www.youtube.com/watch?v=q8SzNKib5-4 Offizielle Dokumentation: https://www.rdocumentation.org/packages/base/versions/3.6.2/topics/grep Wir verwenden die readtext()-Funktion zum Einlesen unserer Märchen. maerchen_df &lt;- readtext(c(&quot;data/Rapunzel_(1850).txt&quot;, &quot;data/Aschenputtel_(1850).txt&quot;)) length(maerchen_df$text) ## [1] 2 maerchen_df ## readtext object consisting of 2 documents and 0 docvars. ## $text ## [1] &quot;# A data frame: 2 × 2&quot; ## [2] &quot; doc_id text &quot; ## [3] &quot; &lt;chr&gt; &lt;chr&gt; &quot; ## [4] &quot;1 Aschenputtel_(1850).txt \&quot;\\&quot;\nEinem rei\\&quot;...\&quot;&quot; ## [5] &quot;2 Rapunzel_(1850).txt \&quot;\\&quot;\nEs war ei\\&quot;...\&quot;&quot; ## ## $summary ## $summary[[1]] ## NULL ## ## ## attr(,&quot;class&quot;) ## [1] &quot;trunc_mat&quot; Durch Einlesen des Märchens mithilfe der readtext()-Funktion haben wir einen Dataframe mit zwei Spalten und zwei Zeilen erhalten. Wir wollen nicht den gesamten Datafrmae, sondern nur die Märchentexte nach Matches zu durchsuchen und wählen deswegen nur die Spalte text als Eingabe: grep(&quot;Rapunzel&quot;, maerchen_df$text, value=F) ## [1] 2 grepl(&quot;Rapunzel&quot;, maerchen_df$text) ## [1] FALSE TRUE regexpr(&quot;Rapunzel&quot;, maerchen_df$text) ## [1] -1 625 ## attr(,&quot;match.length&quot;) ## [1] -1 8 gregexpr(&quot;Rapunzel&quot;, maerchen_df$text) ## [[1]] ## [1] -1 ## attr(,&quot;match.length&quot;) ## [1] -1 ## ## [[2]] ## [1] 625 751 1005 1176 1334 1903 2077 2334 2672 2709 3006 3016 3056 3527 3972 ## [16] 3982 4026 4287 4297 4415 4729 5380 5782 6006 6117 6264 6274 6406 6697 7162 ## [31] 7376 ## attr(,&quot;match.length&quot;) ## [1] 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8 8