punzel&quot; &quot;Rapunzel&quot; ## [19] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [25] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [31] &quot;Rapunzel&quot; Da wir nur nach genau der Zeichenkette “Rapunzel” gesucht haben, wird natürlich auch nur “Rapunzel” gefunden. Mithilfe der Funktionen sub() und gsub() können gefundene Zeichenketten gelöscht oder ersetzt werden. Mit der bereits bekannten Funktion grep() können wir daraufhin überprüfen, ob die Zeichenketten erfolgreich ersetzt wurden. # Zeichenkette ersetzen mit gsub() peterpan_1 &lt;- gsub(&quot;Rapunzel&quot;, &quot;Peter Pan&quot;, maerchen_df$text[2]) grepl(&quot;Rapunzel&quot;, peterpan_1) ## [1] FALSE grepl(&quot;Peter Pan&quot;, peterpan_1) ## [1] TRUE # Zeichenkette ersetzen mit sub() peterpan_2 &lt;- sub(&quot;Rapunzel&quot;, &quot;Peter Pan&quot;, maerchen_df$text[2]) grepl(&quot;Rapunzel&quot;, peterpan_2) ## [1] TRUE # Zeichenkette löschen mit gsub() - geht auch mit sub() rapunzel_cleaned &lt;- gsub(&quot;Rapunzel&quot;, &quot;&quot;, maerchen_df$text[2]) grepl(&quot;Rapunzel&quot;, rapunzel_cleaned) ## [1] FALSE Verständnisfragen: Überprüfen wir die Ergebnisse, so fällt auf, dass bei Anwendung der Funktion sub() nicht alle Instanzen der Zeichenkette “Rapunzel” ersetzt wurden. Woran liegt das? Wie unterscheidet sich folglich das Verhalten der Funktionen gsub() und sub()? Im Beispiel oben haben wir die Funktionen auf das readtext-Objekt angewandt. Es kann aber auch ein Quanteda corpus-Objekt mithilfe von regulären Ausdrücken durchsucht werden: maerchen_korpus &lt;- corpus(maerchen_df) grepl(&quot;Rapunzel&quot;, maerchen_korpus[1]) ## [1] FALSE grepl(&quot;Rapunzel&quot;, maerchen_korpus[2]) ## [1] TRUE grepl(&quot;Rapunzel&quot;, maerchen_korpus) ## [1] FALSE TRUE 6.2.2 Spezielle Pakete: stringr Die Suche mithilfe von R-base-Funktionen kann etwas kompliziert werden, insbesondere, wenn die gefundenen Zeichenketten mithilfe von regmatches() und gregexpr() ausgegeben werden sollen. Außerdem ist es nicht immer möglich, die R-base-Funktionen mithilfe des Pipe-Operators zu verketten. Deswegen gibt es stringr, ein Paket aus dem Tidyverse (s. Kapitel R Basics IV), welches spezialisierte Funktionen zur Arbeit mit regulären Ausdrücken bietet. Die unübersichtliche Kombination von regmatches() und gregexpr() kann beispielsweise durch die stringr-Funktion str_extract_all() ersetzt werden: str_extract_all(maerchen_df$text[2], &quot;Rapunzel&quot;) ## [[1]] ## [1] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [7] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [13] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [19] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [25] &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; &quot;Rapunzel&quot; ## [31] &quot;Rapunzel&quot; Für eine Übersicht über stringr-Funktionen und einen Vergleich mit den R-base-Funktionen siehe: https://stringr.tidyverse.org/articles/from-base.html Verständnisfragen: Welche stringr Funktionen können anstelle der bereits kennengelernten R base Funktionen verwendet werden? Googelt das Paket stringi. Was ist der Unterschied zu stringr? 6.3 Regex Syntax 6.3.1 Basics Syntax Bisher haben wir nur nach einzelnen Worten gesucht. Oft interessieren wir uns aber für komplexere Ausdrücke, Zeichen, oder verschiedene Varianten desselben Worts. Um solche syntaktischen Strukturen zu beschreiben, gibt es verschiedene Regex-Symbole, die im Folgenden vorgestellt werden. Zeichen Bedeutun